        \ der F\xE4higkeit zur Selbstreflexion und zur Wahl zwischen verschiedenen\
        \ Aktionsweisen liegt.\nIn conclusion, the distinction between \"Aktionsweise\"\
        \ and \"Wille\" is an important concept in 19th century philosophy, particularly\
        \ in debates over individual freedom. While some philosophers, such as Friedrich\
